INSERT INTO `page_contents` (`id`, `title`, `slug`, `content`, `is_active`, `created_at`, `updated_at`) VALUES
(1,	'Terms and Conditions',	'terms-and-conditions',	'<p><strong>1.&nbsp;&nbsp; PRIVACY OVERVIEW</strong></p><p>BUILD IT HOME&nbsp;periodically reviews its Privacy Policy and reserves the right, at its discretion, to modify or remove portions of this policy at any time.&nbsp;BUILD IT HOME considers the responsible use of personal information to be of vital importance. This Privacy Policy may be updated by us at any time by posting on the site without any prior notice.</p><p>&nbsp;</p><p>In general, you can visit BUILD IT HOME website without revealing any personal information about yourself.&nbsp;However, there are times when information will be collected, such as when you use our contact form, for billing purposes, appraisals or in connection with community postings such as message boards or feedback to us or to receive information from us. This information may include your name, home or business address and e-mail address. Personal information will only be collected when knowingly and voluntarily submitted.</p><p>&nbsp;</p><p>Also, this Privacy Statement may be supplemented or modified by agreements entered into between us and an individual from time to time. In this Privacy Statement, personal information means any information about an identifiable individual, including contact and demographic details, not including collective information or information regarding a group in summarized form.</p><p><br><strong>Collection of Personal Information</strong></p><p>The Site’s registration form requires users to give us contact information (such as name and email address) and demographic information (and other information that is used by us to provide services. We use the customer contact information from the registration form to send the user information that he or she has requested regarding the Site or regarding services offered by us Contact information provided may be used to contact customers, when necessary, Demographic and profile data is also collected at the Site. Our online surveys ask visitors for contact information (such as email addresses) and demographic information.</p><p>&nbsp;</p><p><strong>Your Information</strong></p><p>BUILD IT HOME does not sell or rent personal information regarding our clients and their customers to any third party. The provision of your personal and or organization information regarding yourself and including any information on your clients and or customers will only be used for the purpose of providing to you and administering our products and services.</p><p>&nbsp;</p><p>BUILD IT HOME will seek your permission to send you further communications at the time you provide us with your personal information. If at any time after submitting your personal information to BUILD IT HOME you would no longer like to receive information from us, simply follow the ‘unsubscribe’ directions at the end of any e-mail communications you receive.</p><p>&nbsp;</p><p>No attempt will be made to identify users or their browsing activities except in the unlikely event of an investigation, where a law enforcement agency may exercise a warrant to inspect server logs. The statistics and log files may be preserved indefinitely and used at any time and in any way necessary to prevent security breaches and to ensure the integrity of the information supplied by BUILD IT HOME.</p><p>&nbsp;</p><p>In&nbsp;general, on BUILD IT HOME websites, IP addresses (a number that is unique to the computer through which you are connected to the internet) are logged to track a user’s session while the user remains anonymous. We&nbsp;analyse&nbsp;this data for certain trends and statistics, such as which parts of our site users are visiting and how long they spend there. In general, we do not link your IP addresses to anything personally identifiable to you. In those limited cases where session information is not anonymous, BUILD IT HOME will provide notice of the practice and an opportunity to ‘opt out.’</p><p>&nbsp;</p><p>When BUILD IT HOME receives information about your session or about you, we may also use it for research or to improve our site and the services we offer you.</p><p>&nbsp;</p><p>BUILD IT HOME does not sell or rent personal information regarding our clients and their customers to any third party. The provision of your personal and or organization information regarding yourself and including any information on your clients and or customers will only be used for the purpose of providing to you and administering our products and services.</p><p>&nbsp;</p><p>BUILD IT HOME will seek your permission to send you further communications at the time you provide us with your personal information. If at any time after submitting your personal information to BUILD IT HOME you would no longer like to receive information from us, simply follow the ‘unsubscribe’ directions at the end of any e-mail communications you receive.</p><p>&nbsp;</p><p>No attempt will be made to identify users or their browsing activities except in the unlikely event of an investigation, where a law enforcement agency may exercise a warrant to inspect server logs. The statistics and log files may be preserved indefinitely and used at any time and in any way necessary to prevent security breaches and to ensure the integrity of the information supplied by BUILD IT HOME.</p><p>&nbsp;</p><p>In&nbsp;general, on BUILD IT HOME websites, IP addresses (a number that is unique to the computer through which you are connected to the internet) are logged to track a user’s session while the user remains anonymous. We&nbsp;analyse&nbsp;this data for certain trends and statistics, such as which parts of our site users are visiting and how long they spend there. In general, we do not link your IP addresses to anything personally identifiable to you. In those limited cases where session information is not anonymous, BUILD IT HOME will provide notice of the practice and an opportunity to ‘opt out.’</p><p>&nbsp;</p><p>When BUILD IT HOME receives information about your session or about you, we may also use it for research or to improve our site and the services we offer you.</p><p>&nbsp;</p><p>We at https://buildithome.com/ (“BUILD IT HOME,” “we,” “us,” or “our”) know that our customers (“you,” “your,” or “yourself”) care about how your personal information is used and shared, and we take your privacy very seriously. Please read the following to learn more about our Privacy Policy. By visiting or using the https://buildithome.com/ website and domain name, any other linked pages, content and any other services we offer from time to time in connection with any of the foregoing (collectively, the “Website”), you agree to the practices and policies set forth in this Privacy Policy, and you hereby acknowledge and consent to our collection and use of your information as described in this Privacy Policy.</p><p>&nbsp;</p><p>we will not collect any information about you that we do not need to make your experience at BUILD IT HOME delightful and will always protect all information about you. We comply with the privacy laws in all regions that we operate in and do more to keep your information confidential. We do everything we reasonably can to protect your rights of privacy on systems and the Website controlled by us, but we are not liable for any unauthorized or unlawful disclosures of your personal and confidential information made by third parties who are not subject to our control, for&nbsp;example, advertisers and websites that have links to our website. You should take note that the information and privacy practices of our business partners, advertisers, sponsors or other sites to which we provide hyperlinks, may be different from ours. This privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this document periodically.</p><p>&nbsp;</p><p><strong>2. WHAT WE COLLECT</strong></p><p>When you register on BUILD IT HOME, we collect some information about you, to complete your profile on BUILD IT HOME. This may include some or all of the following:</p><ul><li>Information about your personal identity such as gender, age, preferences,&nbsp;likes, and dislikes etc.</li><li>Your contact details such as your physical addresses, postal addresses, telephone numbers etc.</li></ul><p>We only collect your Personal Information to conduct our business and to enable us to deliver and improve our Services. We do not for any reason whatsoever sell your Personal Information to any third party or otherwise trade on it.</p><p>&nbsp;</p><p><strong>3. WE DO NOT SHARE YOUR INFORMATION</strong></p><p>We will only disclose your Personal Information in accordance with this Privacy Policy. If we want to use it for any other purpose, we will obtain your prior written consent. If you decline to submit personal information to us, then we will unfortunately not be in a position to provide the Services to you. Any of your information which you provide when you use certain Services and are to an open, public environment or forum including (without limitation) any blog, community or discussion board, is not confidential, does not constitute Personal Information, and is not subject to protection under Privacy Policy. Since such public environments are accessible by third parties, it is possible that third parties may collect and collate and use such information for their own purposes. You should accordingly be careful when deciding to share any of your Personal Information in such public environments. Information, which is disclosed publicly, is also shared with our affiliates, third party service providers, sponsors of competitions etc. unless expressly stated otherwise. We are not liable to you or any third party for any damages that you or any third party may suffer howsoever arising from your disclosure of Personal Information in any public environment. You accordingly disclose information in a public environment at your own risk.</p><p>&nbsp;</p><p><strong>4. WHY WE NEED WHAT WE COLLECT</strong></p><p>We collect your Profiling and Account Information for the following reasons: (a) We need your identity details, contact details, banking information and account history to manage our relationship with you and provide Services to you. We may use this information for suggesting products and promotional offers and schemes. We will only disclose this information as provided below. (b) We use certain of your information in an aggregated form to compile statistical and demographical profiles for our business and marketing activities. We may disclose such information about you, provided that the information is in an aggregated form that is not capable of being used or interpreted in such a manner as to identify you. We collect and store your Service Usage and Transactional Information&nbsp;to:&nbsp;(a) determine and verify the Service Charges payable by you and to administer our relationship with you. (b) comply with any statutory or regulatory requirement. (c) compile statistical and demographical profiles about you for our business and marketing activities and to customise our Services to you. While we are entitled to use such information about you for our own internal business purposes without limitation, we will only disclose it in an aggregated form which is not capable of being used or interpreted in such a manner as to identify you; and (d) monitor your use of our Services for the purposes of ensuring compliance with our Terms of Service. We collect and store your Correspondence Information and Personal Identifiers&nbsp;to:&nbsp;(a) comply with our obligations under the&nbsp;law; and (b) monitor your use of our Services in order to ensure your compliance with our Terms of Service.</p><p>&nbsp;</p><p><strong>5. WHEN WE MAY NEED TO DISCLOSE YOUR INFORMATION</strong></p><p>If we are required to intercept, disclose, monitor and/or store your Personal Information: (a) by law (b) to conduct our business (c) to secure our systems and ensure the privacy of our users (d) to enforce our own rights, we will do so in the manner as prescribed by law.</p><p>&nbsp;</p><p>Such interception, disclosure,&nbsp;monitoring, and storage may take place without your knowledge. In that case, we will not be liable to you or any third party for any damages howsoever arising from such interception, disclosure,&nbsp;monitoring, and storage. In order to ensure that all our Users comply with the Terms of Service, we may monitor your Personal Information to the extent that this may be required to determine compliance and/or to identify instances of non-compliance. To ensure that the security and integrity of our Services are safeguarded, we may monitor your Personal Information. This monitoring may include (without limitation) the filtering of incoming and outgoing electronic data messages to identify, limit and/or prevent the transmission of spam, viruses and/or unlawful, defamatory, obscene or otherwise undesirable material or content. We may under certain circumstances procure an element of the Services from a third-party service provider. To the extent that it may be necessary, and solely for the purposes of providing the Service to you, you agree that we may disclose to such third party any of your Personal Information that may be necessary for the procurement of services from the third party.<br><br><strong>2. TERMS &amp; CONDITIONS</strong></p><p>Please read the following terms and conditions very carefully as your use of services are subject to your acceptance of and compliance with the following terms and conditions (“Terms”).</p><p>&nbsp;</p><p>By subscribing to or using any of our services you agree that you have read, understood and are bound by the Terms, regardless of how you subscribe to or use the services. If you do not want to be bound by the Terms, you must not subscribe to or use our services.</p><p><strong>&nbsp;</strong></p><p><strong>Legal definition</strong></p><p>In these Terms, references to “you”, “User” shall mean the end user accessing the Website, its contents and using the Services offered through the Website, “Service Providers” mean independent third-party service providers.<br><strong>Eligibility:</strong>&nbsp;You must provide true, complete and up-to-date registration information about yourself and agree to abide by these Terms. You must be legally capable to enter into contracts.<br><strong>Payment and Fees:</strong>&nbsp;The payment should be deposit in advance. Revised Option: After getting a&nbsp;plan&nbsp;from us if any change is required by you additional charges will have to pay by the customer if any commitment is not there.<br><br><strong>International Use:</strong></p><p>Recognizing the global nature of the Internet, you agree to comply with all local rules regarding online conduct. Specifically, you agree to comply with all applicable laws regarding the transmission of technical data exported from the country in which you reside. You must comply with all local laws within the territories that you access the Sites.</p><p><strong>Security</strong></p><p>Price and availability of products and services offered on the site are subject to change without prior notice. We provide information about the availability of products or services to a certain extent but you should not rely on such information.&nbsp;BUILD IT HOME will not be liable for any lack of availability of products and services you may order through the site.</p><p>&nbsp;</p><p>BUILD IT HOME sales analysts and representatives are not engineers and do not create or modify plans and designs on their own. They are only authorized to sell plans and services to BUILD IT HOME clients. Based on your requirements, qualified engineers and designers will produce and present the right plans or designs to you. Under certain conditions or for premium customers and solely at the discretion of BUILD IT HOME,BUILD IT HOME may allow direct interaction of clients with the engineering team.</p><p>&nbsp;</p><p>Building a residential or commercial structure is a complex process. Sincere efforts have been made to present architecturally sound plans and designs. The information contained herein is based on analysis and creativity of the BUILD IT HOME staff. We, however, do not vouch for the accuracy or the completeness thereof. This material is for personal information and we are not responsible for any loss incurred due to it &amp; take no responsibility whatsoever for any material, financial, mental, emotional, a&nbsp;notional&nbsp;loss which may arise from the plans and designs above.</p><p><br><strong>3. DELIVERY POLICY</strong></p><p>· Please note that https://buildithome.com delivery commitment is subject to:</p><p>· Timely payments: A project is not considered to be void if the agreed upon / listed payments are not clear.</p><p>· Timely communication from the client: If required information for successful completion of the project is not communicated to us in a timely manner. Any delay or failure of the project arising out of such situations cannot be attributed to https://buildithome.com</p><p>· Completeness of information provided by the client: If the information provided to us is incomplete and/or complete information/scope of the project (service and/or product) is not provided at the beginning of the project, https://buildithome.com is not bound to maintain its delivery.</p><p>· https://buildithome.comcom will not make any compensation for the delay of delivery under any&nbsp;circumstances&nbsp;unless there is a special agreement signed or Committed with a&nbsp;penalty&nbsp;clause for delay in delivery.</p><p><br><strong>Security</strong></p><p>BUILD IT HOME strives to ensure the security,&nbsp;integrity, and privacy of personal information submitted to our sites, and periodically updates its security measures in light of current technologies. You need to be aware of inherent risks associated with the transmission of information via the Internet.&nbsp;BUILD IT HOME cannot guarantee or warrant the security of any personal information you submit to our sites. If you have concerns in this regard, BUILD IT HOME has other ways of obtaining and providing information. Normal mail,&nbsp;telephone, and fax facilities are available.</p><p>&nbsp;</p><p>BUILD IT HOME Websites may contain advertisements and links to other websites operated by third parties. These links are meant for your convenience only. We are not responsible for the privacy policies these third-party materials. Visitors to those sites should refer to their separate privacy policies and practices before disclosing personal information.</p><p>&nbsp;</p><p><strong>Transaction Security Guarantee</strong></p><p>BUILD IT HOME respects your financial privacy and we guarantee the security of all online transactions made with us. Transactions are secured are under strict global information security standards defined for organizations handling credit holder information.</p><p>&nbsp;</p><p><strong>Transaction Failures</strong></p><p>In the event of a failed transaction, you should not worry as no amount is deducted from your credit or debit card. Failed transactions may be due to multiple reasons such as unstable internet connection and/or incorrect billing information provided.</p><p>&nbsp;</p><p>To avoid any disruption, please make sure that you have a strong internet connection once you have finalized your order and check that you have accurately provided the correct billing information. Should you encounter further difficulties in securing your payment, please feel free to contact us at +91 8302254432 and we will immediately attend to your billing concerns.</p><p><strong>For any help, Please Contact our support email: </strong><a href=\"mailto:info@buildithome.com\"><strong>info@buildithome.com</strong></a></p><p>BUILD IT HOME listens.</p><p>&nbsp;</p><p>&nbsp;</p>',	1,	'2022-06-09 12:07:04',	'2022-06-23 09:33:42'),
(2,	'Privacy Policy',	'privacy-policy',	'<p>This privacy policy sets out how&nbsp;Build it Home&nbsp;uses and protects any information that you give us when you use our website.&nbsp;Build it Home&nbsp;is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified, then you can be assured that it will only be used in accordance with this privacy statement.Build it Home&nbsp;may change this policy from time to time by updating this page. You should check this page from time to time to ensure that you are happy with any changes. This policy is effective from 2016.</p><p>&nbsp;</p><p><strong>What we collect</strong></p><p><strong>We may collect the following information:</strong></p><ul><li>Your name &amp; contact information, including email and home address</li><li>Any other information relevant to your enquiry (IE damage type for repair enquiries or postcodes of interest for franchise enquiries)</li><li>We may also capture demographic information using data from Google’s Interest-based advertising or 3rd-party audience data (such as age, gender, and interests) with Google Analytics, to improve user experience</li></ul><p><strong>What we do with the information we gather</strong></p><p>We require this information to understand your needs and provide you with a better service, and in particular for the following reasons:.</p><ul><li>We may use the information to improve our products and services.</li><li>We may use demographic information to help improve overall user experience.</li><li>If you opt-in we may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.</li><li>From time to time, we may also use your information to contact you for market research purposes.</li><li>We may contact you by email, SMS, phone &amp; post.</li></ul><p><strong>Security</strong></p><p>We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p><p><strong>Links to other websites</strong></p><p>Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.</p><p><strong>Controlling your personal information</strong></p><p>You may choose to restrict the collection or use of your personal information in the following ways:</p><ul><li>Whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want to be added to our mailing lists for marketing purposes.</li></ul><p>We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell/ have told us that you wish this to happen.</p><p>You may request details of personal information which we hold about you under the Data Protection Act 1998. A small fee will be payable. If you would like a copy of the information held on you please write to us at Build it Home, Kidderminster, Worcestershire.</p><p>If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible, at the above address. We will promptly correct any information found to be incorrect.</p><p>&nbsp;</p>',	1,	'2022-06-09 12:07:18',	'2022-06-30 09:02:21'),
(3,	'About us',	'about-us',	'<p>BUILD IT HOME Providing the best Architectural Services Solutions in one place. We are working this field in the last 15 years. We are Jaipur, Rajasthan based Company and providing Our Services in all over India with reasonable Costing.<br>One of the biggest achievements in life is considered to be building one’s own house. Whether you are building a home on a plot or have recently purchased an apartment flat, <a href=\"https://buildithome.com/\">https://buildithome.com/</a>helps you with all your planning and design needs without needing a time consuming and expensive visit to an engineer or a designer.<br>BUILD IT HOME is a team of architects, civil engineers, interior designers and a lot of software engineers who love designing, who love construction, who love seeing a idea turn into a beautiful home.<br>BUILD IT HOME has a large collection of house plans and elevations to choose from. The collection is entirely free to browse for your next home building idea. Once you like an idea it is easy to convert it into a complete set of drawings by adding that plan to your cart at BUILD IT HOME. These drawings can be used to hire a contractor and start the construction process without having to hire an architect or a civil engineer. You may also engage BUILD IT HOME to create a totally customized house plan at a fraction of cost. You may also use BUILD IT HOME drawings in parallel to the drawings that your architect provides. Having a couple of options handy is a great idea before you make that dream house. After all, building a house is an event that takes place only 1 or 2 times in one’s lifetime. Plan wisely and plan with a lot of options.<br>The team at BUILD IT HOME wishes you good luck with your design and build efforts and is ready to assist you at any step of the constructions process. We are just a click or call away.<br><strong>Happy Building!</strong></p>',	1,	'2022-06-09 12:07:31',	'2022-06-23 09:32:44');
